import React from 'react';
import { Link,BrowserRouter } from 'react-router-dom';

import './navbar.css';

const NavBar = () => {
  return (
    <div>
      <BrowserRouter>
      <h5>NAVBAR</h5>
      <ul>
        <li><Link to="/Details">Details</Link></li>
        <li><Link to="/Vitals">Vitals</Link></li>
     	</ul>
      <hr />
      </BrowserRouter>  
    </div>
  );
};

export {NavBar};
